import React, { Component } from 'react';


class Login extends Component{
    render(){
        return(
            <div className='landing'>
                    <div className="dark-overlay landing-inner text-light">
                        <div className="container">
                         <h1>Login</h1>
                        </div>
                    </div>
            </div>
        )//end return
    }//end render
}//end class Login


export default Login;
